description:
Watch and recognize the signs of the end times. Become familiar with the times and seasons as we continue our Bible study in REVELATION 13. We read the beast, Antichrist, is going to institute a new economic system. Consider what this &quot;mark&quot; is, but moreover learn what the Bible says about the &quot;mark&quot; and its severity. As we engage in Bible study week after week, remember it's all about Jesus. By the blood of Jesus, will you be saved from the wrath to come?
Athey Creek Christian Fellowship is a body of believers in Wilsonville Oregon desiring to know the Lord in an ever-increasing measure. We are a non- denominational fellowship associating with all who are in the Body of Christ.  
